import Head from 'next/head';

import Menu from '../components/Menu';

import { Jumbotron, Container } from 'reactstrap';

function HomePage() {
    return (
        <>
            <Head>
                <title>Home - Celke</title>
                <meta name="description" content="Site de ... sobre ..." />
                <meta name="author" content="Celke" />
            </Head>

            <Menu />

            <Jumbotron fluid className="descr-top">
                <style>
                    {`.descr-top{
                        background-color: #000;
                        color: #fed136;
                        padding-top: 150px;
                        padding-bottom: 150px;
                        margin-bottom: 0rem !important;
                    }`}
                </style>
                <Container className="text-center">
                    <h1 className="display-4">Titulo</h1>
                    <p className="lead">subtitulo</p>
                    <p>
                        <a href="#" className="btn btn-outline-warning btn-lg">
                            Texto
                        </a>
                    </p>
                </Container>
            </Jumbotron>

            <Jumbotron>
                <Container className="text-center">
                    <div>
                        <h2 className="display-4">Titulo</h2>
                        <p className="lead pb-4">Subtitulo</p>
                    </div>
                </Container>
            </Jumbotron>
        </>
    )
}

export default HomePage;
